import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { retrieveCaughtPokemonAction } from "../actions/catchPokemonAction";

const MyPokemon = ({ userId }) => {
  const dispatch = useDispatch();
  const [pokemonCaught, setPokemonCaught] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      // Dispatch the action instead of calling the function directly
      const data = await dispatch(retrieveCaughtPokemonAction(userId));
      setPokemonCaught(data);
    };

    fetchData();
  }, [dispatch, userId]);

  return (
    <div>
      <h1>My Pok√©mon</h1>
      <ul>
        {pokemonCaught.map((pokemon) => (
          <li key={pokemon._id}>
            {pokemon.caught_by_user}
            {pokemon.pokemon_name}
            {pokemon.url_to_sprite};
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MyPokemon;
